import React from 'react';
import ExternHeader from '../components/ExternHeader';
import Reviews from '../components/reviews';

const Portfolio = () => {
    return (
        <>
            <ExternHeader title="Portfolio" />

            <Reviews home={true} />
        </>
    );
}

export default Portfolio;
